import Vue from 'vue'
import VueRouter from 'vue-router'
import ResourcePage from '../views/ResourcePage.vue'
import DemoPage from '@/views/demo/index.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    component: ResourcePage
  },
  {
    path: '/demo',
    component: DemoPage
  }
]

const router = new VueRouter({
  routes,
  mode: 'hash',
})

export default router
